const Card=(robots)=>{
	const[name,email,id]=robots;
	return(

			<div className='tc bg-light-green dib br3 ma2 grow'>
			<img alt='robots' src={`https://robohash.org/${id}?200x200`}/>
			<div>
			<h2>{name}</h2>
			<p> {email}</p>

			</div>
			</div>

		);
}
export default Card;
